package lesson8;

public class NestedWhileLoop {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
int i=1;
while(i<=5)
{
	i++;
	System.out.println("i");
	System.out.println("-----------");
	
	int j=5;
	while(j<=10)
	{
		j++;
		System.out.println("j");
		
	
	}
}
	}

}
